import React from 'react'


function Location(props) {

    function backStep() {
      props.setFormStep(0);
    }

    async function nextStep() {
      props.setFormStep(2);
    }

    return (
        <div className="card">
        <div className="authBox">
            <h1>Location</h1>
            <div className="servicesBox">
                <button className="btn-primary" type="submit" value="Maraetai" onClick={nextStep}><p>Maraetai</p></button>
                <button className="btn-primary" type="submit" value="Beachlands" onClick={nextStep}><p>Beachlands</p></button>
            </div>
          <input className="btn-secondary" type="submit" value="Back" onClick={backStep}/>

          </div>
        </div>
    )
}

export default Location
